import {Link} from 'react-router-dom';
import {ProductConsumer} from '../context';

class Product extends Component {
  render () {
    const {id, name, img, price, inCart} = this.props.product;
    return (
     <div>
      <h1>HELLO NEW PRODUCT</h1>
     </div>
    )
  };
}
 export default Product;
